import { useState } from "react";

const Form = () => {
  const [data, setData] = useState({
    firstName: "",
    lastName: "",
    
  });

  return (
    <form>
      <div>
        <label for="LastName"></label>
        <input
          type="text"
          name="LastName"
          onChange={(event) => setData({ ...data, name: event.target.value })}
        />
      </div>
      <div>
        <label for="FirstName"></label>
        <input
          type="text"
          name="FirstName"
          onChange={(event) => setData({ ...data, name: event.target.value })}
        />
      </div>
      <div>
        <label for="Email"></label>
        <input
          type="email"
          name="Email"
          onChange={(event) => setData({ ...data, name: event.target.value })}
        />
      </div>
      <div>
        <label for="FirstName"></label>
        <input
          type="text"
          name="FirstName"
          onChange={(event) => setData({ ...data, name: event.target.value })}
        />
      </div>
    </form>
  );
};

export default Form;
